import "List.css";
const LocationList = () => {
  return (
    <table>
      <tr>
        <th>Name</th>
        <th>Country</th>
        <th>Latitude</th>
        <th>Longitude</th>
        <th>Wind Prob.</th>
        <th>When to go</th>
      </tr>
    </table>
  );
};

export default LocationList;
